import {Button} from 'react-bootstrap';
import {Entry} from './pages/entry/Entry.Page'
import {DefaultLayout} from './layout/default-layout/DefaultLayout'
import "./App.css"
import { Dashboard } from './pages/dashboard/Dashboard.page';
import { AddTicket } from './pages/new-ticket/addTicketpage';
import { TicketList } from './pages/ticket-listing/TicketList.page';
import { Ticket } from './pages/ticket/Ticket.Page';
import{BrowserRouter as Router,Routes,Route,Link} from "react-router-dom";
import { Switch } from 'react-router-dom';

function App() {



  return (

    <div className="App">
  <Router>
  <DefaultLayout>
  <Routes>
    <Route exact path="/" element={<Entry/>}></Route>
    <Route exact path="/dashboard" element={<Dashboard></Dashboard>}></Route>
    <Route exact path="/add-ticket" element={<AddTicket/>}></Route>
    <Route exact path="/tickets" element={<TicketList/>}></Route>


  </Routes>
  </DefaultLayout>
  </Router>




    </div>
  );
}

export default App;
